async function PLISTs(t){return new class{constructor(t=[]){this.name="Plist v1.0.0";this.opts=t;this.request={url:"https://json2plist-production.up.railway.app/convert.php",headers:{"Content-Type":"application/x-www-form-urlencoded; charset=UTF-8",Accept:"text/javascript, text/html, application/xml, text/xml, */*"}}}parse(t){this.request.body="do=plist2json&content="+encodeURIComponent(t);return await $.http.post(this.request).then(v => JSON.parse(v.body))}stringify(t){this.request.body="do=json2plist&content="+encodeURIComponent(JSON.stringify(t));return await $.http.post(this.request).then(v => v.body)}}(t)}
